import React from "react";
import "./Table.css";
import "./functionality/ToolTip.css";
import ToolTip from "./functionality/ToolTip";

const ChapterContent = ({ subTopicData }) => {
  // Extract levels and other details from subTopicData
  const { title, levels } = subTopicData;

  return (
    <div className="chapter-content">
      <h2>{title || "Untitled Subtopic"}</h2>
      
      <table>
        <thead>
          <tr>
            <th>Basic Level</th>
            <th>Medium Level</th>
            <th>Advanced Level</th>
          </tr>
        </thead>
        <tbody>
          {/* Assuming levels are structured as an object with keys 'basic', 'medium', 'advanced' */}
          <tr>
            <td>
              {levels.basic && levels.basic.length > 0 ? (
                levels.basic.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Basic Level Content Available</p>
              )}
            </td>
            <td>
              {levels.medium && levels.medium.length > 0 ? (
                levels.medium.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Medium Level Content Available</p>
              )}
            </td>
            <td>
              {levels.advanced && levels.advanced.length > 0 ? (
                levels.advanced.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Advanced Level Content Available</p>
              )}
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default ChapterContent;
